import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import AllProducts from './AllProducts';
import Subscription from './Subscription';
import InfluencerCollab from './InfluencerCollab';
import Kits from './Kits';
import PrivacyPolicy from './PrivacyPolicy';
import YorisoiCraft from './YorisoiCraft';
import LegalNotice from './LegalNotice';
import TermsOfService from './TermsOfService';

const Influencer = () => <div style={{padding: '2em'}}><h2>インフルエンサーコラボページ</h2><p>ここにコラボ内容が入ります。</p></div>;
const Patchwork = () => <div style={{padding: '2em'}}><h2>よりそいクラフトページ</h2><p>ここにクラフト内容が入ります。</p></div>;

const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<App />} />
        <Route path="/subscription" element={<Subscription />} />
        <Route path="/all-products" element={<AllProducts />} />
        <Route path="/influencer_subscription" element={<InfluencerCollab />} />
        <Route path="/patchwork_kit_website" element={<YorisoiCraft />} />
        <Route path="/kits" element={<Kits />} />
        <Route path="/privacy_policy" element={<PrivacyPolicy />} />
        <Route path="/legal_notice" element={<LegalNotice />} />
        <Route path="/terms_of_service" element={<TermsOfService />} />
      </Routes>
    </BrowserRouter>
  </React.StrictMode>
);

reportWebVitals();
